import React, {Component} from 'react';

import './Welcome.css';

class Welcome extends Component {
constructor(){
    super() 
      this.state = {
        data: []
      }
    
  }
  componentDidMount() {
    $.ajax({
       url: "http://project.razorbee.com/signage%20/signage-rb/client/player/play.json",
       type: "GET",
       dataType: 'json',
       ContentType: 'application/json',
       success: function(data) {
         
         this.setState({data: data});
       }.bind(this),
       error: function(jqXHR) {
         console.log(jqXHR);
       }.bind(this)
    })
  }
  render() {
    
        
    return (
      <table>
      <tbody>{this.state.data.map(function(item, key) {
             
               return (
                  <tr key = {key}>
                      <td>{assets.filename}</td>
                      <td>{assets.duration}</td>
                     
                  </tr>
                )
             
             })}</tbody>
       </table>
    )
  }
}


export default Welcome;
